import React, { Component } from "react";
export default class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            };
           
    }
    beginQuiz(){
        this.setState({
            redirect: true
          });

    }

    render() {
        return (         
            <button type="button" onClick={this.beginQuiz} className="btn btn-primary btn-block" >BEGIN QUIZ</button>
        );
    }
}
